"use strict";

var httpErrors = require("http-errors");
var ValidationError = require("../Exceptions/ValidationError");
var ClientError = require("../Exceptions/ClientError");
//const logger = require("../utils/logger");
var config = require("../Config/app");
module.exports = function (err, req, res, next) {
  var status = err.status || 500;
  var httpError = httpErrors(status);
  var errorMessage = err.message || "Unknown error";
  var response = {
    code: status
  };
  if (err instanceof ValidationError) {
    Object.assign(response, {
      message: httpError.message
    });
    Object.assign(response, {
      errorValidation: err.validationErrors
    });
  } else if (err instanceof ClientError) {
    Object.assign(response, {
      message: errorMessage
    });
    //logger.info(errorMessage, { url: req.originalUrl, method: req.method });
  } else {
    Object.assign(response, {
      message: httpError.message
    });
    //logger.error(err.stack, { url: req.originalUrl, method: req.method });
  }

  if (config.isDev) {
    Object.assign(response, {
      error: err.stack
    });
  }
  res.status(status);
  res.json(response);
};
//# sourceMappingURL=data:application/json;charset=utf-8;base64,

sourcesContent:
const httpErrors = require("http-errors");
const ValidationError = require("../Exceptions/ValidationError");
const ClientError = require("../Exceptions/ClientError");
//const logger = require("../utils/logger");
const config = require("../Config/app");

module.exports = function(err, req, res, next) {
    const status = err.status || 500;
    const httpError = httpErrors(status);
    const errorMessage = err.message || "Unknown error";
    const response = { code: status };

    if (err instanceof ValidationError) {
    Object.assign(response, { message: httpError.message });
    Object.assign(response, { errorValidation: err.validationErrors });
    } else if (err instanceof ClientError) {
    Object.assign(response, { message: errorMessage });
    //logger.info(errorMessage, { url: req.originalUrl, method: req.method });
    } else {
    Object.assign(response, { message: httpError.message });
    //logger.error(err.stack, { url: req.originalUrl, method: req.method });
    }

    if (config.isDev) {
    Object.assign(response, { error: err.stack });
    }

    res.status(status);
    res.json(response);
};

